import React from 'react';

import './App.css';
import Technologies from './Technologies';
import Sidebar from './sideber';

const App = () => {
  return (
    <div>
      <header>
        <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fru.m.wikipedia.org%2Fwiki%2F%25D0%25A4%25D0%25B0%25D0%25B9%25D0%25BB%3APatch_pocket_topstitching.png&psig=AOvVaw3o6G3hEOZ9oo86alRr5cUs&ust=1596453548593000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJCD9Iqz_OoCFQAAAAAdAAAAABAD'></img>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}
export default App;
